-- ----------------------------
-- Table structure for employees
-- ----------------------------
DROP TABLE IF EXISTS `employees`;
CREATE TABLE `employees` (
  `id` varchar(10) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL COMMENT 'id karyawan hanya untuk konsumsi komputer dan programmer',
  `employee_code` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `nik` varchar(16) CHARACTER SET latin2 COLLATE latin2_general_ci DEFAULT NULL COMMENT 'nomor induk karyawan',
  `name` varchar(40) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT 'nama lengkap karyawan',
  `birth_place` varchar(30) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT 'tempat lahir',
  `birth_date` date DEFAULT NULL COMMENT 'tanggal lahir',
  `division` varchar(10) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT 'Divisi karyawan bekerja',
  `gender` enum('L','P') CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT 'L' COMMENT 'L laki-laki, P Perempuan',
  `religion` int DEFAULT NULL COMMENT 'agama kepercayaan',
  `education_level` enum('SD','SMP','SMA','DIPLOMA','SARJANA','MASTER','DOKTORAL','PROFESOR','LAIN-LAIN') CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT 'Level Pendidikan',
  `address` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT 'alamat tempat yang ditinggali',
  `phone_number` varchar(18) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT 'nomor telepon seluler',
  `npwp_number` varchar(25) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT 'nomor npwp pribadi',
  `email` varchar(45) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `joint_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL,
  `employee_type` enum('Tetap','Kontrak') CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `job_description` text CHARACTER SET latin1 COLLATE latin1_swedish_ci,
  `status` enum('0','1','D') CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT '1' COMMENT 'status customer aktif atau tidak',
  `created_at` datetime DEFAULT NULL,
  `modified_at` timestamp NULL DEFAULT NULL,
  `created_by` int DEFAULT NULL,
  `modified_by` int DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `deleted_by` int DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `employee_code` (`employee_code`) USING BTREE,
  KEY `FK_datak_pendidikan` (`education_level`) USING BTREE,
  KEY `Index_8` (`name`,`birth_date`) USING BTREE,
  KEY `divisi` (`division`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

