-- ----------------------------
-- View structure for view_fee_customers
-- ----------------------------
DROP VIEW IF EXISTS `view_fee_customers`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_fee_customers` AS select `customers`.`customer_name` AS `customer_name`,`employees`.`employee_code` AS `employee_code`,`employees`.`name` AS `employee_name`,`fee_customers`.`id` AS `id`,`fee_customers`.`customer_id` AS `customer_id`,`fee_customers`.`employee_id` AS `employee_id`,`fee_customers`.`fee_value` AS `fee_value`,`fee_customers`.`description` AS `description`,`fee_customers`.`status` AS `status`,`fee_customers`.`created_at` AS `created_at`,`fee_customers`.`created_by` AS `created_by`,`fee_customers`.`modified_at` AS `modified_at`,`fee_customers`.`modified_by` AS `modified_by`,`fee_customers`.`deleted_at` AS `deleted_at`,`fee_customers`.`deleted_by` AS `deleted_by` from ((`fee_customers` left join `customers` on((`fee_customers`.`customer_id` = `customers`.`id_customer`))) left join `employees` on((`customers`.`sales_id` = `employees`.`id`)));

